import React from 'react';
import { Box, Typography, Grid } from '@material-ui/core';
import { SkillsData } from './SkillsData';


const Skills = () => {
    return (<>
        <Grid item md={6} sm={6} xs={12}>
            <Box px={5}>
                {SkillsData.map((item, index) => { return (<Box key={index} my={2}> <Typography variant="h6">{item.barTitle}</Typography> <div className="progress"> <div className={item.barClassName} style={{ width: item.barWidth }}> <Typography variant="body2">{item.barWidth}</Typography> </div> </div> </Box>) })}
            </Box>
        </Grid>
    </>)
}

export default Skills
